import React, { FC } from 'react';

import { Button, PageHeader } from 'antd';

import 'antd/dist/antd.css';
import './header.scss';
import { useAppDispatch, useAppSelector } from '../../hooks/redux';
import { requestDataSlice } from '../../store/Reducers/RequestDataSlice';

const Header: FC = () => {
  const dispatch = useAppDispatch();
  const { setActiveSortBy } = requestDataSlice.actions;
  return (
    <div className="site-page-header-ghost-wrapper">
      <PageHeader
        ghost={false}
        title="Posts"
        extra={[
          <Button onClick={() => alert('name')}>by Name</Button>,
          <Button onClick={() => alert('title')}>by Title</Button>,
          <Button onClick={() => alert('likes')}>By likes</Button>,
        ]}
      ></PageHeader>
    </div>
  );
};
export default Header;
